__NUXT_JSONP__("/drugs/Camptothecin_Sodium", (function(a,b,c,d){return {data:[{drug:{slug:b,emaEpar:[],fdaDrugLabel:[],id:b,nciThesaurus:{casRegistry:a,chebiId:a,chemicalFormula:a,definition:"The sodium salt of camptothecin, an alkaloid isolated from the Chinese tree Camptotheca acuminata, with antineoplastic activity.  During the S phase of the cell cycle, camptothecin selectively stabilizes topoisomerase I-DNA covalent complexes, thereby inhibiting religation of topoisomerase I-mediated single-strand DNA breaks and producing potentially lethal double-strand DNA breaks when encountered by the DNA replication machinery. The sodium salt of camptothecin is more water-soluble than the parent molecule.",fdaUniiCode:"3L6CT9UWOM",identifier:"C2344",preferredName:c,semanticType:"Organic Chemical",subclassOf:["C1904"],synonyms:["CAMPTOTHECIN SODIUM",c,"Camptothecin Sodium Salt","Camptothecin sodium","Camptothecin, sodium salt","Sodium camptothecin"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FCamptothecin_Sodium",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("","Camptothecin_Sodium","Camptothecin Sodium","2021-10-30T13:37:33.163Z")));